I definitely wore the right tank top for this workout- Burn Baby Burn!! 🔥 

Not much left in the gas ⛽️ tank after a week of TAKING IT UP A NOTCH 👆🏼 but I wasn’t about to back down from the challenge to finish this week strong 💪🏼 Grabbed my “heavier weights than I REALLY think I should be using😬🙈😬”....because I know what I CAN do- and I want to DO MORE!! 💥🤛🏼

